import React from 'react';
import { Fetch } from 'react-request';
import console from "react-console";

const name = "fun";
console.log(<p>{name}</p>) 

export default class AlphaRequest extends React.Component {
  render() {
    return (
        <Fetch url="https://polisen.se/api/events?DateTime=2020-01-01&type=Misshandel">
        {({ fetching, failed, data }) => {
          if (fetching) {
            return <div>Loading data...</div>;
          }

          if (failed) {
            return <div>The request did not succeed.</div>;
          }

          if (data) {
            return (
                console.log("Polisen", {data}) 
            );
          }
          return null;
        }}
      </Fetch>
    );
  }
}
